import React from "react";
import ReactDOM from "react-dom";
import $ from "jquery";
import Page from "./Page";
import TemperatureSlider from "./TemperatureSlider";
import "./Stylesheet.css";


$(document).ready(function() {
    $.getJSON("./Elements.json", function(jsonData) {
        ReactDOM.render(<Page json={jsonData} />, document.getElementById("main"));

        let startTemperature = 273;
        $("#temperatureSlider").val(startTemperature);
        $("#temperatureInput").val(startTemperature);
        TemperatureSlider.editStates(startTemperature, jsonData);
    });
});
